j=b.tt('My husband and I have always enjoyed attending the Christmas Eve service at our church. In the early years of our marriage we had a special tradition of bundling up in warm clothing after the service to hike up a nearby hill where 350 glowing lights were strung from tall poles in the shape of a star. There\u2014often in the snow whisper our reflections on Jesus miraculous birth while we gazed out over the city. Meanwhile, many people in the town were looking up at the bright, string-light star from the valley below. That star is a reminder of the birth of our Saviour. The Bible tells of magi "from the east" who arrived in Jerusalem seeking "the one who [had] been born king of the Jews" (Matthew 2:1-2). Theyd been watching the skies and had seen the star "when it rose" (v. 2). Their journey took them onward from Jerusalem to Bethlehem, the star going "ahead of them until it stopped over the place where the child was" (v. 9). There, they "bowed down and worshipped him" (v. 11). Christ is the source of light in our lives both figuratively (as the one who guides us) and literally as the one who created the sun, moon and stars in the sky (Colossians 1:15-16). Like the magi who "were overjoyed" when they saw His star (Matthew 2:10), our greatest delight is in knowing Him as the Saviour who came down from the heavens to dwell among us. "We have seen his glory" (John 1:14)!',A.b([B.bw,B.c3],a0),B.lM,"\ud83d\udcd6 Sermon Content")
